svg.script:
function hideUnblurredPaths() {
  var elements = document.querySelectorAll("[id^='path_']:not([id^='path_item_blurred'])");;
  for (element of elements) {
    element.style.display="none";
  }
}

function showBlurredPaths() {
  var elements = document.querySelectorAll("[id^='path_item_blurred']");;
  for (element of elements) {
    element.style.display="inline";
  }
}

function moveTo(subsection_name) {
  hideUnblurredPaths();
  showBlurredPaths();
  document.getElementById("path_item_blurred_" + subsection_name).style.display="none"
  document.getElementById("path_item_" + subsection_name).style.display="inline"
  document.getElementById("path_background_" + subsection_name).style.display="inline"
}
